import React, { PureComponent, useState } from 'react';// The code below sets the state of the component when the PDF document is successfully loaded

// The code below returns a PDF component with various functionalities such as zooming, page navigation, and fullscreen mode

import '../meetstyle/File.css';
import 'react-pdf/dist/esm/Page/AnnotationLayer.css';
import { Document, Page, pdfjs } from "react-pdf";

pdfjs.GlobalWorkerOptions.workerSrc = `//cdnjs.cloudflare.com/ajax/libs/pdf.js/${pdfjs.version}/pdf.worker.js`;

const Pdf = ({ prfUrl }) => {
  const [pageNumber, setPageNumber] = useState(1);
  const [pageNumberInput, setPageNumberInput] = useState(1);
  const [pageNumberFocus, setPageNumberFocus] = useState(false);
  const [numPages, setNumPages] = useState(1);
  const [pageWidth, setPageWidth] = useState(600);
  const [fullscreen, setFullscreen] = useState(false);

  const lastPage = () => {
    if (pageNumber === 1) {
      return;
    }
    setPageNumber(pageNumber - 1);
    setPageNumberInput(pageNumber - 1);
  };

  const nextPage = () => {
    if (pageNumber === numPages) {
      return;
    }
    setPageNumber(pageNumber + 1);
    setPageNumberInput(pageNumber + 1);
  };

  const onPageNumberFocus = () => {
    setPageNumberFocus(true);
  };

  const onPageNumberBlur = () => {
    setPageNumberFocus(false);
    setPageNumberInput(pageNumber);
  };

  const onPageNumberChange = (e) => {
    let value = e.target.value;
    value = value <= 0 ? 1 : value;
    value = value >= numPages ? numPages : value;
    setPageNumberInput(value);
  };

  const toPage = (e) => {
    if (e.keyCode === 13) {
      setPageNumber(Number(e.target.value));
    }
  };

  const pageZoomOut = () => {
    if (pageWidth <= 503) {
      return;
    }
    setPageWidth(pageWidth * 0.8);
  };

  const pageZoomIn = () => {
    setPageWidth(pageWidth * 1.2);
  };

  const pageFullscreen = () => {
    if (fullscreen) {
      setFullscreen(false);
      setPageWidth(600);
    } else {
      setFullscreen(true);
      setPageWidth(window.screen.width - 40);
    }
    
  };
  const onDocumentLoadSuccess = ({ numPages }) => {
    setNumPages(numPages);
    setPageNumber(1);
    setPageNumberInput(1);
    setPageWidth(600);
  }; 
  
  return (
    <div className="pdf-container">
      <div className="pdf-toolbar">
        <div className="pdf-toolbar__left">
          <button className="pdf-toolbar__button" onClick={lastPage}>
            <i className="fas fa-chevron-left"></i>
          </button>
          <button className="pdf-toolbar__button" onClick={nextPage}>
            <i className="fas fa-chevron-right"></i>
          </button>
          <div className="pdf-toolbar__page">
            <input
              type="number"
              value={pageNumberFocus ? pageNumberInput : pageNumber}
              onFocus={onPageNumberFocus}
              onBlur={onPageNumberBlur}
              onChange={onPageNumberChange}
              onKeyDown={toPage}
            />
            <span> / {numPages}</span>
          </div>
        </div>
        <div className="pdf-toolbar__right">
          <button className="pdf-toolbar__button" onClick={pageZoomOut}>
            <i className="fas fa-search-minus"></i>
          </button>
          <button className="pdf-toolbar__button" onClick={pageZoomIn}>
            <i className="fas fa-search-plus"></i>
          </button>
          <button className="pdf-toolbar__button" onClick={pageFullscreen}>
            {fullscreen ? (
              <i className="fas fa-compress"></i>
            ) : (
              <i className="fas fa-expand"></i>
            )}
          </button>
        </div>
      </div>
      <div className="pdf-wrapper">
        <Document file={prfUrl} onLoadSuccess={onDocumentLoadSuccess}>
          <Page pageNumber={pageNumber} width={pageWidth} />
        </Document>
      </div>
    </div>
  );
}
